import React, { Component } from "react";
import SearchIcon from "./white-search-icon.jpg";
import "./NavBar.css";

class Navbar extends Component {
  state = { options: [] };

  generateId() {
    return Math.random()
      .toString(36)
      .substr(2, 9);
  }

  render() {
    return (
      <nav className="navbar">
        <div>
          <ul></ul>
        </div>
        <div>
          <img
            className="navbar-search-icon"
            height="23"
            width="23"
            alt="search"
            src={SearchIcon}
          ></img>
        </div>
      </nav>
    );
  }
}

export default Navbar;
